## Since the Letter has to be within the edgecase same letters,hence all
## those non edge case letters are going to be removed eventually and only
## the edge case letters are going to stay behind
class Solution:
    def winnerOfGame(self, colors: str) -> bool:
        alice,bob=(0,0)
        for index in range(1, len(colors)-1):
            if (colors[index]=="A" and  
                    colors[index-1]=="A" and colors[index+1]=="A"):
                alice+=1    
            elif (colors[index]=="B" and  
                    colors[index-1]=="B" and colors[index+1]=="B"):
                bob+=1
        return alice>bob
if __name__=="__main__":
    colors = ""
    print(Solution().winnerOfGame(colors=colors))